import SparkImg from "../static/spark-mockup.png";
import { Link } from "react-router-dom";

export default function Experience({company, description, link, image}) {
    const images = require.context(image, true);
    loadImages = imageName => (assets(`./`))

    return (
        <div className="experience">
            <div className="exp--left">
                <h1 className="exp--company">{company}</h1>
                <p className="exp--description">{description}</p>
                <Link className="exp--button" to={link}>Read More</Link>
            </div>
            <div className="exp--right">
                <img className="exp--img" src={img} alt={`${company} mockup`} />
            </div>
        </div>
    )
}
